import React from 'react'
import IMG from '../assets/loginbg.jpg'
import '../assets/Card.css'

const Card = (props) => {

  return (
    <div>
      <div class="card shadow-cardShadow" style={{ 'background': props.color }}>
        <h2 class="card__title">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</h2>
        <p class="card__apply">
          <a class="card__link" href="#">Apply Now </a>
        </p>
      </div>

    </div>
  )
}

export default Card;
